import React, { Component } from "react";
import { connect } from "react-redux";
import MovieCard from "./MovieCard";
import Spinner from "../layout/Spinner";

export class MoviesContainer extends Component {
  render() {
    const movies = [
      {
        Title: "Avengers: Infinity War",
        Year: "2018",
        imdbID: "tt4154756",
        Type: "movie",
        Poster:
          "https://m.media-amazon.com/images/M/MV5BMjMxNjY2MDU1OV5BMl5BanBnXkFtZTgwNzY1MTUwNTM@._V1_SX300.jpg",
      },
      {
        Title: "Captain America: Civil War",
        Year: "2016",
        imdbID: "tt3498820",
        Type: "movie",
        Poster:
          "https://m.media-amazon.com/images/M/MV5BMjQ0MTgyNjAxMV5BMl5BanBnXkFtZTgwNjUzMDkyODE@._V1_SX300.jpg",
      },
      {
        Title: "World War Z",
        Year: "2013",
        imdbID: "tt0816711",
        Type: "movie",
        Poster:
          "https://m.media-amazon.com/images/M/MV5BNDQ4YzFmNzktMmM5ZC00MDZjLTk1OTktNDE2ODE4YjM2MjJjXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg",
      },
    ];
    console.log(movies);
    let content = "";
    content = movies.map((m, index) => {
      return (
        <div className="card" key={index}>
          <p>{m.Title}</p>
          <p>{m.Year}</p>
          <p>{m.Poster}</p>
          <p>{m.imdbID}</p>
        </div>
      );
    });

    return (
      <div>
        <div>
          <p>Total result is </p>
          <Spinner />
          <div className="row">{content}</div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  movies: state.movies.movies.Search,
});

export default connect(mapStateToProps)(MoviesContainer);
